const mongoose = require("mongoose");

const studentSchema = new mongoose.Schema({
    email:{
        type:String
    },
    password:{
        type:String,
        required:true,
    },
    admissionNo:{
        type:Number,
        required:true
    },
    name:{
        type:String,
        required:true
    },
    program:{
        type:String,
        required:true
    },
    semester:{
        type:String,
        required:true,
    },
    batch:{
        type:Number,
        required:true
    },
    image:{
        type:String,
        default:"data:image/jpeg;base64,"
    },
    address:{
        type:String,
        required:true,
    },
    annualIncome:{
        type:String
    },
    phoneNumber:{
        type:String
    },
    staffAdvisor:{
        type:String
    },
    department:{
        type:String,
        required:true
    },
    twelfthPercentage:{
        type:Number,
        required:true
    },
    cgpa:{
        type:Number,
    }

});



const facultySchema = new mongoose.Schema({
    employeeNo: {
        type: String,
        required: true
    },
    role: {
        type: Number,
        required: true
    },
    name: {
        type: String,
        required: true,
    },
    department: {
        type: String,
        required: true
    },
    email: {
        type: String,
        required: true
    },
    phoneNumber: {
        type: String,
        required: true
    },
    image:{
        type:String,
        default:"data:image/jpeg;base64,"
    },
    dateOfJoining: {
        type: Date,
        required: true
    },
});


const principalSchema = new mongoose.Schema({
    employeeNo: {
        type: String,
        required: true
    },
    name:{
        type:String,
        required:true,
    },
    email: {
        type: String,
        required: true
    },
    phoneNumber: {
        type: String,
        required: true
    },
    image:{
        type:String,
        default:"data:image/jpeg;base64,"
    },
    dateOfJoining: {
        type: Date,
        required: true
    },
    
});

const Student =  mongoose.model("student", studentSchema);
const Faculty = mongoose.model("faculty", facultySchema);

module.exports = { Student,Faculty };
